import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'GHE_Assignment';
}

<div class="nav-bar">
  <img src="assets/images/home-icon.png" alt="home icon">
  <img src="assets/images/track-icon.png" alt="track icon">
  <img src="assets/images/search-icon.png" alt="search icon">
  <img src="assets/images/account-icon.png" alt="account icon">
</div>
